import {StyleSheet} from 'react-native'
import {Center} from "native-base";
import {StyledWRIndexTag} from "../components/WRIndex.styled";

export default function App() {
    return (
        <Box>
            <StyledWRIndexTag/>
        </Box>
    )
}

const styles = StyleSheet.create({
    container: {
        alignItems: 'center',
        flexGrow: 1,
        justifyContent: 'center',
    },
    link: {
        color: 'blue',
    },
    textContainer: {
        alignItems: 'center',
        marginTop: 16,
    },
    text: {
        alignItems: 'center',
        fontSize: 24,
        marginBottom: 24,
    },
})
